// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/AccessControl.sol";

contract ContractB is AccessControl {
    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");
    address public superAdmin;

    constructor() {
        superAdmin = msg.sender;
        grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        grantRole(ADMIN_ROLE, msg.sender);
    }

    function addAdmin(address _admin) public onlyRole(ADMIN_ROLE) {
        grantRole(ADMIN_ROLE, _admin);
    }

    function removeAdmin(address _admin) public onlyRole(ADMIN_ROLE) {
        revokeRole(ADMIN_ROLE, _admin);
    }

    function transferAdminRole(address _newAdmin) public {
        require(hasRole(ADMIN_ROLE, msg.sender), "Not an admin");
        grantRole(ADMIN_ROLE, _newAdmin);
        revokeRole(ADMIN_ROLE, msg.sender);
    }

    function renounceAdminRole() public {
        renounceRole(ADMIN_ROLE, msg.sender);
    }
}

